fmt::Debug difícilmente se ve compacto y limpio, por lo que a menudo es ventajoso personalizar la apariencia de la salida. Esto se hace mediante la implementación manual de fmt::Display , que utiliza el marcador de impresión {}. La implementación se ve así: // Importa (a través de `use`) el módulo `fmt` para hacerlo disponible.
use std::fmt; // Define una estructura para la cual se implementará `fmt::Display`. Esta es
// una tupla estructural llamada `Structure` que contiene un `i32`.
struct Structure(i32); // Para usar el marcador `{}`, el trait `fmt::Display` debe implementarse
// manualmente para el tipo.
impl fmt::Display for Structure { // Este trait requiere `fmt` con esta firma exacta. fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // Escribe estrictamente el primer elemento en el flujo de salida // proporcionado: `f`. Devuelve `fmt::Result` que indica si la // operación tuvo éxito o falló. Ten en cuenta que `write!` utiliza una sintaxis muy similar a `println!`. write!(f, "{}", self.0) }
} fmt::Display puede ser más limpio que fmt::Debug, pero esto presenta un problema para la biblioteca std. ¿Cómo deberían mostrarse los tipos ambiguos? Por ejemplo, si la biblioteca std implementara un estilo único para todos los Vec<T>, ¿qué estilo sería? ¿Sería alguno de estos dos? Vec<path>: /:/etc:/home/username:/bin (dividido por :) Vec<number>: 1,2,3 (dividido por ,) No, porque no hay un estilo ideal para todos los tipos y la biblioteca std no presume dictar uno. fmt::Display no se implementa para Vec<T> ni para ningún otro contenedor genérico. Por lo tanto, fmt::Debug debe usarse para estos casos genéricos. Sin embargo, esto no es un problema porque para cualquier nuevo tipo de contenedor que no sea genérico, se puede implementar fmt::Display. use std::fmt; // Importa `fmt` // Una estructura que contiene dos números. `Debug` será derivado para que los resultados puedan
// contrastarse con `Display`.
#[derive(Debug)]
struct MinMax(i64, i64); // Implementa `Display` para `MinMax`.
impl fmt::Display for MinMax { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // Utiliza `self.number` para hacer referencia a cada punto de datos posicional. write!(f, "({}, {})", self.0, self.1) }
} // Define una estructura donde los campos son nombrables para comparación.
#[derive(Debug)]
struct Point2D { x: f64, y: f64,
} // De manera similar, implementa `Display` para `Point2D`.
impl fmt::Display for Point2D { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // Personaliza para que solo se denoten `x` e `y`. write!(f, "x: {}, y: {}", self.x, self.y) }
} fn main() { let minmax = MinMax(0, 14); println!("Compara estructuras:"); println!("Display: {}", minmax); println!("Debug: {:?}", minmax); let big_range = MinMax(-300, 300); let small_range = MinMax(-3, 3); println!("El rango grande es {big} y el pequeño es {small}", small = small_range, big = big_range); let point = Point2D { x: 3.3, y: 7.2 }; println!("Compara puntos:"); println!("Display: {}", point); println!("Debug: {:?}", point); // Error. Se implementaron tanto `Debug` como `Display`, pero `{:b}` // requiere que se implemente `fmt::Binary`. Esto no funcionará. // println!("¿Cómo se ve Point2D en binario: {:b}?", point);
} Entonces, fmt::Display se ha implementado pero fmt::Binary no lo ha hecho, y por lo tanto no se puede usar. std::fmt tiene muchos de estos traits y cada uno requiere su propia implementación. Esto se detalla más en std::fmt .

