Implementar fmt::Display para una estructura donde los elementos deben manejarse secuencialmente es complicado. El problema es que cada write! genera un fmt::Result. Manejar correctamente esto requiere tratar todos los resultados. Rust proporciona el operador ? para este propósito exacto. Usar ? en write! se ve así: // Intenta `write!` para ver si genera un error. Si genera un error, devuelve
// el error. De lo contrario, continúa.
write!(f, "{}", valor)?; Con ? disponible, implementar fmt::Display para un Vec es sencillo: use std::fmt; // Importa el módulo `fmt`. // Define una estructura llamada `Lista` que contenga un `Vec`.
struct Lista(Vec<i32>); impl fmt::Display for Lista { fn fmt(&self, f: &mut fmt::Formatter) -> fmt::Result { // Extrae el valor usando indexación de tuplas, // y crea una referencia a `vec`. let vec = &self.0; write!(f, "[")?; // Itera sobre `v` en `vec` mientras enumeras el contador de iteraciones // en `count`. for (count, v) in vec.iter().enumerate() { // Para cada elemento excepto el primero, agrega una coma. // Usa el operador ? para devolver en caso de errores. if count != 0 { write!(f, ", ")?; } write!(f, "{}", v)?; } // Cierra el corchete abierto y devuelve un valor fmt::Result. write!(f, "]") }
} fn main() { let v = Lista(vec![1, 2, 3]); println!("{}", v);
}

