Un atributo es metadatos aplicados a algún módulo, crate o elemento. Estos metadatos pueden utilizarse para: Compilación condicional de código Establecer el nombre de la crate, la versión y el tipo (binario o biblioteca) Desactivar lints (advertencias) Habilitar características del compilador (macros, importaciones globales, etc.) Enlazar a una biblioteca externa Marcar funciones como pruebas unitarias Marcar funciones que formarán parte de una prueba de rendimiento Macros tipo atributo Los atributos tienen la apariencia #[atributo_externo] o #![atributo_interno], la diferencia entre ellos es dónde se aplican. #[atributo_externo] se aplica al elemento inmediatamente después de él. Algunos ejemplos de elementos son: una función, una declaración de módulo, una constante, una estructura, un enum. Aquí tienes un ejemplo donde el atributo #[derive(Debug)] se aplica a la estructura Rectangle: #[derive(Debug)]
struct Rectangle { width: u32, height: u32,
} #![atributo_interno] se aplica al elemento que lo contiene (típicamente un módulo o una crate). En otras palabras, este atributo se interpreta como aplicado a todo el ámbito en el que se encuentra. Aquí tienes un ejemplo donde #![allow(unused_variables)] se aplica a toda la crate (si se coloca en main.rs): #![allow(unused_variables)] fn main() { let x = 3; // Esto normalmente advertiría sobre una variable no utilizada.
} Los atributos pueden tomar argumentos con diferentes sintaxis: #[atributo = "valor"] #[atributo(clave = "valor")] #[atributo(valor)] Los atributos pueden tener múltiples valores y también pueden estar separados en varias líneas: #[atributo(valor, valor2)] #[atributo(valor, valor2, valor3, valor4, valor5)]

